INSERT INTO `hotels` VALUES ('H00001', '上海市', '上海新锦江酒店', 1195, 1241, 'https://dimg04.c-ctrip.com/images/200m0g0000007rsgk782E_W_1080_808_R5_D.jpg', '上海黄浦区长乐路161号', '上海新锦江大酒店，位于繁华淮海路商业区，43层全玻璃建筑，提供东方待客之道和时尚设计。', '49257171', '1990-10-01', '上海新锦江大酒店以温馨的东方待客之道，及时尚创新的设计风格而闻名遐迩。酒店坐落于繁华的淮海路商业街区，毗邻新天地、田子坊等时尚中心与人民广场、外滩等城市中心。交通便捷，经高架和高速道路可以快速前往虹桥机场及浦东国际机场，4条地铁线路可直达，与具有老上海韵味的13号线淮海中路站隔街相望。感受东方魅力，体验时尚中国！新锦江欢迎您！', '自助餐，￥193每份', '入住办理人需年满18岁', '14:00:00', '12:00:00');
INSERT INTO `hotels` VALUES ('H00002', '上海市', '上海金门酒店', 1296, 55, 'https://dimg04.c-ctrip.com/images/200f0g0000007u83y0420_W_1080_808_R5_D.jpg', '上海市黄浦区南京西路108号', '上海金门大酒店位于南京西路，毗邻人民广场和南京路商业街，交通便利，提供典雅舒适的住宿和美食体验。', '38574624', '1989-03-12', '上海金门大酒店位于南京西路，邻近人民广场和南京路商业步行街、外滩，交通便利。酒店隶属于锦江国际管理集团，拥有各式典雅舒适的客房，并设有地中海意大利情调餐厅和资深名厨主理的中西名馔，尤以“佛跳墙”特色佳肴著称。酒店蕴含历史积淀和人文情怀，为海内外宾客提供典雅居停所。', '自助餐，￥75每份', '入住办理人需年满18岁', '14:00:00', '13:00:00');
INSERT INTO `hotels` VALUES ('H00003', '上海市', '康铂酒店', 1080, 645, 'https://dimg04.c-ctrip.com/images/220u0z000000mnhr393CC_W_1080_808_R5_D.jpg', '上海市静安区南苏州路1455号', '坐落于苏州河畔南苏州路，是法国康铂品牌在上海的旗舰店。酒店提供摩登时尚的法式风情体验，拥有舒适的客房和多功能厅，餐厅提供中、法菜肴和精选美酒，满足商务和休闲需求，部分房型还配备空气净化器。', '22768438', '2016-06-01', '康铂酒店坐落于苏州河畔南苏州路，是法国康铂品牌在上海的旗舰店。提供摩登时尚的法式风情体验，距离静安雕塑公园和上海自然博物馆仅5分钟路程。酒店拥有舒适现代客房，包括商务舒适大床房、浪漫豪华大床房和家庭高级双床房。酒店设有中、法菜肴的餐厅和酒吧，提供精选葡萄酒、烈酒、鸡尾酒及花式咖啡。1楼配备150平米多功能厅，可举办各类会议和私人派对。部分房型配备空气净化器。无论商务出行还是度假旅游，客人都能享受到智能、健康的旅居生活。', '无早餐', '入住办理人需年满18岁', '16:00:00', '12:30:00');
INSERT INTO `hotels` VALUES ('H00004', '上海市', '锦江都城经典', 493, 85, 'https://dimg04.c-ctrip.com/images/0201q1200089w5jhl0852_W_1080_808_R5_D.jpg', '上海黄浦区南京东路98号', '上海锦江都城经典南京东路外滩酒店位于上海外滩南京东路，依托美丽的黄浦江景观。步行可至南京路、豫园、人民广场等景点，周边商场众多，包括新世界大丸百货等。酒店前身为南洋兄弟银行，建于20世纪二十年代，保留了Art Deco和海派设计风格。设有百余间特色客房，融合传统与现代设计元素，提供舒适体验。配备两个会议室，适合商务和旅游需求。', '62670267', '2000-05-01', '上海锦江都城经典南京东路外滩酒店位于上海外滩南京东路，依托黄浦江美丽风景。步行可达南京路、豫园、人民广场、上海博物馆等繁华景点，过江直通上海陆家嘴中心地区。周边商场众多，包括新世界大丸百货、中央商场、宏伊国际广场等，同时还有诸多国际一线品牌专卖店。酒店前身为南洋兄弟银行，建于20世纪二十年代，保留了Art Deco和海派设计风格。设有百余间特色客房，融合传统与现代设计元素，创造温馨家居感。此外，酒店配备两个大小规格的会议室，适合商务和旅游需求。', '自助餐，￥50每份', '入住办理人需年满18岁', '14:00:00', '12:00:00');
INSERT INTO `hotels` VALUES ('H00005', '上海市', '上海陆家嘴万信R酒店', 190, 575, 'https://dimg04.c-ctrip.com/images/20090u000000iva619BE2_W_1080_808_R5_D.jpg', '上海浦东新区崮山路688号', '上海万信R酒店：时尚年轻，华丽贴心，舒适轻奢，提供全方位服务。', '36417052', '2018-05-01', '上海万信R酒店位于浦东新区崮山路，地处内环线陆家嘴金融区内，近地铁6号线（北洋泾路站），地铁9号线（芳甸路站），配备专属停车场，自驾至新国际博览中心约10分钟，至外滩、世博园区、南京路步行街、上海自由贸易区、上海迪斯尼乐园约20分钟。\n酒店拥有百余间崭新客房，精选配套，让舒适与轻奢相拥；酒店圣罗拉餐厅环境舒适安逸，主打西餐、辅以粤菜、川菜、沪菜，在此享受由港粤名厨精心烹饪的佳肴，舌尖不由自主的跳起了芭蕾。万信R酒店设计，突破了“万信酒店”一贯理念，时尚年轻，秉承R文化，华丽，贴心，轻松，享受。', '自助餐，￥193每份', '入住办理人需年满18岁', '18:00:00', '13:00:00');
INSERT INTO `hotels` VALUES ('H00006', '北京市', '北京索菲特大酒店', 1157, 506, 'https://dimg04.c-ctrip.com/images/200s14000000x8czg3F9F_W_1080_808_R5_D.jpg', '北京朝阳区建国门南大街2号', '北京索菲特大酒店位于朝阳区建国门南大街，地处市中心繁华外交商务区，提供便捷出行。', '38344640', '2010-07-20', '北京索菲特大酒店位于朝阳区建国门南大街，坐落于繁华的外交商务区，毗邻天安门广场和紫禁城。以“耀动帝都”为设计主题，展现华美典雅。客房设有数码遥控调节色彩气氛，配备先进设施，营造摩登型格。酒店设有酒吧、餐厅，提供美妙娱乐及餐饮体验；水疗中心、健身房助宾客重焕活力；1500平米会议宴会空间，使宾客纵享奢华、美好时光。', '自助餐，￥200每份', '入住办理人需年满18岁', '14:00:00', '12:30:00');
INSERT INTO `hotels` VALUES ('H00007', '北京市', '北京四季酒店', 1332, 754, 'https://dimg04.c-ctrip.com/images/02018120008xpt3jmF4C3_W_1080_808_R5_D.jpg', '北京朝阳区亮马桥路48号', '北京四季酒店位于朝阳区核心商圈，拥有高雅客房、美食餐厅和水疗中心，提供豪华享受和多功能会议场地。', '74971819', '1992-03-12', '北京四季酒店位于朝阳区核心商圈，距离亮马桥地铁站仅6分钟步行路程。酒店拥有精致客房及套房，设施先进完备，融合古老韵味和现代时尚设计。享受米其林指南一星中餐厅、意大利餐厅及三间酒廊提供的高雅美食。水疗中心提供奢华水疗体验，室内游泳池及健身中心开放全天候。宴会空间广阔，专业服务为每个欢聚细节打造优雅回忆。', '自助餐，￥193每份', '入住办理人需年满18岁', '16:00:00', '12:00:00');
INSERT INTO `hotels` VALUES ('H00008', '北京市', '北京花博时尚酒店', 1095, 1059, 'https://dimg04.c-ctrip.com/images/0206p12000bejbkcp3EEE_W_1080_808_R5_D.jpg', '北京顺义区安平路3号', '酒店位于后沙峪镇安平街，临近后沙峪地铁站，周边设施完善', '10457325', '2016-06-01', '酒店位于后沙峪镇安平街，距离后沙峪地铁站很近，酒店周边配套设施齐全。装修极具现代气息，处处散发现代城市的魅力。客房均提供商务写字台，宽带上网，网络电视，独立卫生间等设施设备。有中小型会议室，凡租用会议室的顾客均可免费使用会议室的标准试听设备，投影仪，麦克风等。酒店免费提供会议期间茶水服务，纸笔，写字板，指示牌，签到台等。良好的环境，优质的服务是您中小型会议的成功之选。欢迎您的光临！', '自助餐，￥50每份', '入住办理人需年满18岁', '14:00:00', '13:00:00');
INSERT INTO `hotels` VALUES ('H00009', '北京市', '艺龙海雅酒店', 980, 383, 'https://dimg04.c-ctrip.com/images/0202i12000awicbxb243E_W_1080_808_R5_D.jpg', '北京通州区云景北里52号楼贵友大厦A座1层', '位于通州区，距离梨园地铁站很近，拥有精致客房和免费停车场，提供丰富早餐和健身房。', '66558355', '2020-05-01', '位于北京市通州区云景北里52号楼贵友大厦A座，距离通州梨园地铁站很近，到达北京环球度假区地铁4站地仅需12分钟.酒店拥有装修精致、风格各异的客房，所有客房都视野广阔，光线明亮。另外酒店提供免费停车场，让您停车无忧。11层餐厅每天给贵客提供丰富多种的营养早餐，开启您美好愉快的一天。12层公共区域还提供免费的健身房及洗衣服务，让您宾至如归。24小时的酒店前台无论多晚都在颐尚等您，为五湖四海的贵客提供高质量，舒适超值的住宿服务。在颐尚没有陌生，一切都很温馨!', '自助餐，￥60每份', '入住办理人需年满18岁', '18:00:00', '12:30:00');
INSERT INTO `hotels` VALUES ('H00010', '北京市', '北京丽思卡尔顿酒店', 1218, 1130, 'https://dimg04.c-ctrip.com/images/0223x12000b6uk1qp7820_W_1080_808_R5_D.jpg', '北京朝阳区华贸中心建国路甲83号', '位于京城CBD华贸中心，邻近大型购物中心SKP，提供豪华客房、多家餐厅和水疗中心，是商务和休闲旅行者的理想选择。', '85740893', '2018-05-01', '酒店坐落于京城CBD华贸中心，紧邻大型购物中心SKP，名胜古迹和文化地标皆近在咫尺。乘坐地铁1号线或酒店班车直达北京环球影城度假村。酒店整体内部设计当代经典，将英伦庄园风格与现代感十足的美学设计、先进技术与豪华舒适融为一体。酒店拥有各类豪华客房，2家餐厅及酒吧，更有意大利餐厅ATTA，日式料理四叶可供选择。其他设施包括水疗中心，健身中心，室内游泳池，1100平方米的会议空间，648平方米大宴会厅和市中心稀缺的户外花园。', '自助餐，￥75每份', '入住办理人需年满18岁', '14:00:00', '12:00:00');
INSERT INTO `hotels` VALUES ('H00011', '武汉市', 'YES花园酒店', 234, 487, 'https://dimg04.c-ctrip.com/images/02011120008kd8ear31E2_W_1080_808_R5_D.jpg', '武汉江汉区常青路77号', '汉口站旁特色酒店，112间装饰典雅客房，配备智能系统和健身设施。多功能餐饮及会议场地，为商旅客人提供舒适环境。', '59878093', '2016-06-01', '酒店毗邻汉口站，地理位置优越，交通出行便利。是一家集住宿、休闲健身、餐饮、会议等多功能于一体的特色酒店。酒店设有112间装饰典雅的各类客房：客房内均配有智能系统及24小时热水、中央空调等，带给您惬意感受的同时，又不失对品味的追求。酒店内另设有健身房、棋牌室、多功能厅等，全方位的服务和完善的现代化设施设备是各位商旅客人的理想选择。我们将用 “更多的关爱”及细心周到的服务为您提供一个舒适的环境。', '自助餐，￥38每份', '入住办理人需年满18岁', '14:00:00', '12:00:00');
INSERT INTO `hotels` VALUES ('H00012', '武汉市', '铂越酒店', 150, 991, 'https://dimg04.c-ctrip.com/images/0206p120008v1lw0y9365_W_1080_808_R5_D.jpg', '武汉江岸区后湖大道66号', '武汉铂越酒店，紧邻后湖站，地理位置优越，交通便利，是商务出行和家庭聚会的理想选择。', '32095809', '2020-05-01', '武汉铂越酒店位于武汉市江岸区后湖大道，紧邻武孝城际铁路后湖站，周边有武汉大型成熟社区汉口花园、武汉全民健身中心、江岸区检察院、武汉市实验学校，属于汉口北生活区（天河国际机场），地理位置优越，交通便利，靠近地铁6号线石桥站与地铁8/号线中一路站，乘地铁6号线及8号线可以贯通武汉三镇，以居住功能为主体的兼具商业和交通繁荣，是您商务出行、走亲访友、家庭朋友聚会理想住所。', '自助餐，￥50每份', '入住办理人需年满18岁', '14:00:00', '13:00:00');
INSERT INTO `hotels` VALUES ('H00013', '武汉市', '秋果酒店', 55, 356, 'https://dimg04.c-ctrip.com/images/0205u120009njd945A082_W_1080_808_R5_D.jpg', '武汉江汉区香港路257号15号楼', '位于武汉市江汉区香港路257号，地铁6号线三眼桥地铁站D出口步行可达，交通便利。提倡自然健康，提供土家族绿色产品茗和深夜暖胃粥。', '23090843', '2018-05-01', '酒店位于武汉市江汉区香港路257号鹏程院子内，地铁6号线三眼桥地铁站D出口距离酒店步行可达。酒店邻毗中山公园万象城，汉口火车站，汉口江滩，汉口金融中心、武商MALL·国广、等核心商圈，周边交通十分便捷。倡导自然、健康、率性，同时还能享受我们土家族的绿色产品茗；我们有深夜暖胃粥，还配备了维生素加油站，随时补充营养；标配的新风系统，让您随时呼吸新鲜空气。', '无早餐', '入住办理人需年满18岁', '16:00:00', '12:30:00');
INSERT INTO `hotels` VALUES ('H00014', '武汉市', '武汉光谷广场杨家湾亚朵酒店', 645, 1001, 'https://dimg04.c-ctrip.com/images/0206y120009t6piw31BA3_W_1080_808_R5_D.jpg', '武汉洪山区雄楚大道533号', '武汉光谷商圈酒店，提倡人文生活，拥有舒适客房和便利设施，为商旅人士提供理想住宿体验。', '45983203', '2010-07-20', '酒店位于武汉光谷商圈，毗邻立体交通路网，交通便利。距离火车站约半小时车程，周边有知名品牌商家和医院。作为一家提倡人文、温暖、有趣生活方式的微笑公司，酒店主打“阅读”和“摄影”主题，营造浓厚的人文氛围和朴实静谧的气质。客房采用普兰特系列优质床品和高端洗浴用品，同时设有大堂书吧和精品摄影作品分享，让客人感受人文与经典气息。餐厅提供武汉特色小吃，24小时洗衣房和健身房为客人提供便利。酒店致力于为商旅人士打造理想住宿体验，为客人提供舒适、简约的居停空间。', '无早餐', '入住办理人需年满18岁', '14:00:00', '12:00:00');
INSERT INTO `hotels` VALUES ('H00015', '武汉市', '武汉希诺轻奢酒店', 85, 201, 'https://dimg04.c-ctrip.com/images/1mc3z12000bcbzsme898A_W_1080_808_R5_D.jpg', '武汉洪山区高新大道792号崇文中心B1栋3楼', '位于武汉光谷中心城核心区的酒店，毗邻地铁和众多企业总部，提供智能控制系统和个性化服务。', '84932093', '2016-06-01', '酒店位于武汉市东湖高新区光谷中心城核心区，地处武汉光谷黄金主轴高新大道与光谷六路交汇处，毗邻地铁11号线，有轨电车、BRT快速公交环伺。毗邻小米、华为、武汉未来科技城、武汉光谷生物城等，各大企业总部云集；光谷大悦城购物中心，众多时尚购物中心及著名景点轻松通达.11号线光谷六路C1出口。房间配备独立的WIFI和百兆光纤，酒店配套智能AI语音设备，集节能、绿色、人文科技等特点的酒店智能控制系统，使顾客的个性化需求得到满足。我们将以热情的服务，舒适的房间，期待您的到来。', '自助餐，￥45每份', '入住办理人需年满18岁', '18:00:00', '13:00:00');
INSERT INTO `hotels` VALUES ('H00016', '天津市', '武汉希诺轻奢酒店', 85, 201, 'https://dimg04.c-ctrip.com/images/1mc3z12000bcbzsme898A_W_1080_808_R5_D.jpg', '武汉洪山区高新大道792号崇文中心B1栋3楼', '位于武汉光谷中心城核心区的酒店，毗邻地铁和众多企业总部，提供智能控制系统和个性化服务。', '84932093', '2016-06-01', '酒店位于武汉市东湖高新区光谷中心城核心区，地处武汉光谷黄金主轴高新大道与光谷六路交汇处，毗邻地铁11号线，有轨电车、BRT快速公交环伺。毗邻小米、华为、武汉未来科技城、武汉光谷生物城等，各大企业总部云集；光谷大悦城购物中心，众多时尚购物中心及著名景点轻松通达.11号线光谷六路C1出口。房间配备独立的WIFI和百兆光纤，酒店配套智能AI语音设备，集节能、绿色、人文科技等特点的酒店智能控制系统，使顾客的个性化需求得到满足。我们将以热情的服务，舒适的房间，期待您的到来。', '自助餐，￥45每份', '入住办理人需年满18岁', '18:00:00', '13:00:00');
